import React, { Component } from 'react';
import axios from 'axios';

export default class Preview extends Component {
    constructor(props) {
        super(props);
        
        this.state = {
            name: '',
            description: '',
            numOfReps: '',
            url: '',
            date: new Date()
        }
    }

    componentDidMount() {
        axios.get('http://localhost:5000/exercise/routineid'+this.props.data)
            .then(res => {
                this.setState({
                    name: res.data.name,
                    description: res.data.description,
                    date: new Date(res.data.date)
                })
            })
            .catch(function (err) {
                console.log(err)
            });
    }
    render() {
        return(
            <div>
                {this.props.data}
            </div>
        )
    }
}
